import { useQuery, gql } from "@apollo/client";

const Page = (props) => {
  const QUERY_EVENT = gql`
    query {
      queryEvent(first: 30) {
        id
        name
        beginsON
      }
    }
  `;
  const { data, error, loading } = useQuery(QUERY_EVENT);
  console.log(data, error, loading);
  return "Ceci est la page " + props.title;
};

export default Page;
